import React, { Fragment } from "react";
import Header from "../Header";
import styles from "../NewTaskPage/AddTask.module.css";
import classes from "./LoginPage.module.css";
import style from '../SignUpPage/SignupPage.module.css';
import LoginSignupButton from "../LoginSignupButton";

const LoginPage = (props) => {
  return (
    <Fragment>
      <Header />
      <div className={classes["login-div"]}>
        <div className={styles.heading}>Login</div>
        <div className={classes["login-tile"]}>
          <div className={classes["div-left"]}>
            <div>
              <div className={classes["login-heading"]}> Enter username:</div>
              <input className={classes["login-input-text"]} type="text" />
            </div>
            <div>
              <div className={classes["login-heading"]}> Enter password:</div>
              <input className={classes["login-input-text"]} type="text" />
            </div>
            <LoginSignupButton/>
          </div>
          <div className={classes["vertical"]}></div>
          <div className={classes["div-right"]}>div right</div>
        </div>
        <div className={classes["sign-up-option"]}>sign up option here</div>
      </div>
    </Fragment>
  );
};

export default LoginPage;
